import axios from "axios";
const url="http://localhost:8080/BuyS"

export const getByIdB=(id)=>{
    return axios.get(`${url}/getById/${id}`)
}
export const saveBuyB=(buy)=>{
    return axios.post(`${url}/saveBuy`,buy)
}
